def simulate_model(trial_data, phi=1, beta=1, gamma=1):
    model_predictions = []
    delta = 1e-06

    def softsign(x):
        return x / (1 + abs(x))

    def clip(x, min_val, max_val):
        return max(min(x, max_val), min_val)

    def sign(x):
        if x > 0:
            return 1
        elif x < 0:
            return -1
        else:
            return 0

    def tanh(x):
        return (math.exp(x) - math.exp(-x)) / (math.exp(x) + math.exp(-x))

    def sigmoid(x):
        return 1 / (1 + math.exp(-x))

    for trial in trial_data:
        F1 = trial.get("F1", 0)
        F2 = trial.get("F2", 0)
        F3 = trial.get("F3", 0)
        F4 = trial.get("F4", 0)
        F5 = trial.get("F5", 0)
        F6 = trial.get("F6", 0)
        F7 = trial.get("F7", 0)
        F8 = trial.get("F8", 0)
        F9 = trial.get("F9", 0)
        F10 = trial.get("F10", 0)
        F11 = trial.get("F11", 0)

        a = (F1 + F2 + F3 + F4 + F5 + F6 + F7 + F8 + F9 + F10 + F11) + delta
        a_mod = 1.08 * a * (1 + 0.012 * math.sin(a + 0.045))
        z = a_mod * (1 + 0.008 * math.cos(a + 0.065)) * (1 + 0.005 * math.sin(a + 0.115)) * (1 + 0.004 * math.cos(a + 0.085)) * (1 + 0.006 * math.sin(a + 0.035) * math.cos(a + 0.055)) * (1 + 0.003 * math.sin(a + 0.03) * math.cos(a + 0.05))
        w = (phi - 0.5) / phi

        if z >= 0:
            f_adapt = clip(1.002 * (z**w * (math.log(1+z))**(1-w) * softsign(z)), -30, 30)
        else:
            f_adapt = phi * (softsign(z + 1e-6))**16

        T = sum(a**k * (1/2)**k for k in range(41))

        extra_base = math.exp(-a/0.1) * (z/(1+abs(z))) * (1 + 0.005 * math.sin(1/(1+a))) * (1 + 0.002 * math.cos(0.5*a)) * (1+0.003*math.cos(0.3*a))**2 * (1+0.004*math.cos(0.3*a))**2 * (1+0.0025*math.cos(0.7*a)) * (1 + tanh(0.05*a)) * (1 + sigmoid(0.01*a)) * (1 + 0.002*math.cos(3*a)) * (1 + 0.002*math.sin(2.5*a) + 0.001*math.cos(3.5*a) + 0.0015*math.sin(3*a)) * (1 + sigmoid(0.03*a)) * (1 + tanh(0.07*a)) * (1 + math.cos(3.1*a)) * (1 + sigmoid(0.04*a)) * (1 + tanh(0.08*a)) * (1 + math.cos(3.2*a)) * (1 + sigmoid(0.05*a)) * (1 + tanh(0.1*a)) * (1 + math.cos(3.4*a)) * (1 + sigmoid(0.05*a)) * (1 + tanh(0.1*a))

        extra = extra_base**(0.9478 + 0.00018*math.log(1+a)) * (1 + tanh(0.05*a))

        Exponent = (0.9478 + 0.00018*math.log(1+a)) * (1 + 0.004*math.sin(2.8*a) + 0.001*math.cos(3.8*a) + 0.003*math.sin(3.4*a) + 0.002*math.cos(4.4*a))

